INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('302aa4ee-f388-415b-9ef2-ed5b5bc00f21', 'Wie kann ich eine Bestellung aufgeben?', 'Sie kÃ¶nnen ganz einfach eine Bestellung aufgeben:<br><br><strong>1.</strong> Durchsuchen Sie unsere Produktkategorien oder verwenden Sie die Suchfunktion.<br><strong>2.</strong> FÃ¼gen Sie gewÃ¼nschte Produkte zum Warenkorb hinzu.<br><strong>3.</strong> Gehen Sie zum Warenkorb und klicken Sie auf "Zur Kasse".<br><strong>4.</strong> WÃ¤hlen Sie eine Lieferadresse oder geben Sie eine neue ein.<br><strong>5.</strong> WÃ¤hlen Sie die Zahlungsmethode und bestÃ¤tigen Sie Ihre Bestellung.<br><br>Nach der BestÃ¤tigung erhalten Sie eine BestellbestÃ¤tigung per E-Mail.', 'Bestellung', 1, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('4fac38ef-c164-4919-93c1-d32c36ccc07e', 'Wie lange dauert die Lieferung?', 'Die Lieferzeit hÃ¤ngt von Ihrer Adresse und der VerfÃ¼gbarkeit der Produkte ab:<br><br><strong>â€¢ Standardlieferung:</strong> In der Regel 1-3 Werktage<br><strong>â€¢ Expresslieferung:</strong> Am selben Tag (falls verfÃ¼gbar)<br><strong>â€¢ Abholung:</strong> Sie kÃ¶nnen Ihre Bestellung auch direkt im GeschÃ¤ft abholen<br><br>Sie erhalten eine E-Mail mit der geschÃ¤tzten Lieferzeit nach der BestellbestÃ¤tigung.', 'Lieferung', 3, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('cd8cf45a-8fe0-4068-b323-509a6b6be114', 'Kann ich meine Bestellung stornieren?', 'Ja, Sie kÃ¶nnen Ihre Bestellung stornieren:<br><br><strong>â€¢ Vor der Bearbeitung:</strong> Sie kÃ¶nnen Ihre Bestellung direkt in Ihrem Konto stornieren.<br><strong>â€¢ Nach der Bearbeitung:</strong> Bitte kontaktieren Sie unseren Kundenservice so schnell wie mÃ¶glich.<br><br>Bitte beachten Sie, dass bereits versandte Bestellungen mÃ¶glicherweise nicht mehr storniert werden kÃ¶nnen. In diesem Fall kÃ¶nnen Sie die RÃ¼cksendung nach Erhalt durchfÃ¼hren.', 'Bestellung', 4, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('7da3ab4e-2354-4d0f-b89b-95f2165f7e58', 'Welche Zahlungsmethoden werden akzeptiert?', 'Wir akzeptieren folgende Zahlungsmethoden:<br><br><strong>â€¢ Barzahlung bei Lieferung:</strong> Sie zahlen den Betrag direkt beim Lieferanten.<br><strong>â€¢ Kartenzahlung bei Lieferung:</strong> Sie kÃ¶nnen mit EC-Karte oder Kreditkarte bei der Lieferung bezahlen.<br><br>Bitte beachten Sie, dass die verfÃ¼gbaren Zahlungsmethoden je nach Lieferadresse variieren kÃ¶nnen.', 'Zahlung', 2, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('aa242875-f1cb-4dfe-9a98-f8234d85a1cf', 'Wie kann ich mein Konto erstellen?', 'Die Kontoerstellung ist ganz einfach:<br><br><strong>1.</strong> Klicken Sie auf "Registrieren" in der oberen rechten Ecke.<br><strong>2.</strong> Geben Sie Ihre persÃ¶nlichen Daten ein (Name, E-Mail, Passwort).<br><strong>3.</strong> BestÃ¤tigen Sie Ihre E-Mail-Adresse Ã¼ber den Link, den wir Ihnen per E-Mail senden.<br><strong>4.</strong> Nach der BestÃ¤tigung kÃ¶nnen Sie sich anmelden und einkaufen.<br><br>Mit einem Konto kÃ¶nnen Sie Bestellungen verfolgen, Adressen speichern und vieles mehr.', 'Konto', 5, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('7a9c5cfa-28e2-469d-9a41-2f70f8977a92', 'Wie kann ich meine Lieferadresse Ã¤ndern?', 'Sie kÃ¶nnen Ihre Lieferadresse auf verschiedene Weise verwalten:<br><br><strong>â€¢ WÃ¤hrend der Bestellung:</strong> Sie kÃ¶nnen eine neue Adresse eingeben oder eine gespeicherte Adresse auswÃ¤hlen.<br><strong>â€¢ In Ihrem Profil:</strong> Gehen Sie zu "Profil" â†’ "Adressen" und fÃ¼gen Sie neue Adressen hinzu oder bearbeiten Sie bestehende.<br><br>Sie kÃ¶nnen mehrere Adressen speichern und bei jeder Bestellung die gewÃ¼nschte Adresse auswÃ¤hlen.', 'Lieferung', 8, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('b80eab53-79bd-4ce7-aec8-d664d6bf910a', 'Kann ich Produkte zu meinen Favoriten hinzufÃ¼gen?', 'Ja, absolut! Sie kÃ¶nnen Produkte zu Ihren Favoriten hinzufÃ¼gen:<br><br><strong>1.</strong> Durchsuchen Sie unsere Produkte.<br><strong>2.</strong> Klicken Sie auf das Herz-Symbol auf einem Produkt.<br><strong>3.</strong> Das Produkt wird zu Ihren Favoriten hinzugefÃ¼gt.<br><br>Sie kÃ¶nnen alle Ihre Favoriten Ã¼ber das "Favoriten"-MenÃ¼ in der Navigation anzeigen. Von dort aus kÃ¶nnen Sie Produkte direkt zum Warenkorb hinzufÃ¼gen.', 'Produkte', 9, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('4355f5c7-1adb-4f67-a135-ef9636bcb17d', 'Gibt es eine Mindestbestellmenge?', 'Ja, wir haben eine Mindestbestellmenge fÃ¼r Lieferungen. Die genaue Mindestbestellmenge wird beim Bestellvorgang angezeigt und kann je nach Lieferadresse variieren.<br><br>FÃ¼r Abholungen im GeschÃ¤ft gibt es keine Mindestbestellmenge. Sie kÃ¶nnen auch jederzeit Produkte zu Ihrem Warenkorb hinzufÃ¼gen, um die Mindestbestellmenge zu erreichen.', 'Bestellung', 7, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('1431a772-3e8c-4fed-a12c-37cc4f96eb29', 'Was mache ich, wenn ich mein Passwort vergessen habe?', 'Kein Problem! Sie kÃ¶nnen Ihr Passwort einfach zurÃ¼cksetzen:<br><br><strong>1.</strong> Klicken Sie auf "Anmelden" und dann auf "Passwort vergessen".<br><strong>2.</strong> Geben Sie Ihre E-Mail-Adresse ein.<br><strong>3.</strong> Sie erhalten eine E-Mail mit einem Link zum ZurÃ¼cksetzen des Passworts.<br><strong>4.</strong> Klicken Sie auf den Link und erstellen Sie ein neues Passwort.<br><br>Falls Sie keine E-Mail erhalten, Ã¼berprÃ¼fen Sie bitte Ihren Spam-Ordner.', 'Konto', 6, true, '2025-11-16 21:06:12.769', '2025-11-16 21:06:12.769');
INSERT INTO public.faqs (id, question, answer, category, sort_order, is_active, created_at, updated_at) VALUES ('3fa3aa5e-dc65-4c57-b63d-c7a6b0ee6396', 'Wie kann ich den Status meiner Bestellung verfolgen?', 'Sie kÃ¶nnen den Status Ihrer Bestellung jederzeit einsehen:<br><br><strong>1.</strong> Melden Sie sich in Ihrem Konto an.<br><strong>2.</strong> Gehen Sie zu "Meine Bestellungen".<br><strong>3.</strong> Klicken Sie auf die gewÃ¼nschte Bestellung, um Details anzuzeigen.<br><br>Sie sehen den aktuellen Status (z.B. "In Bearbeitung", "Versandt", "Geliefert") und erhalten E-Mail-Benachrichtigungen bei StatusÃ¤nderungen.', 'Bestellung', 10, true, '2025-11-16 21:06:12.77', '2025-11-16 21:06:12.77');
